import React, { useState } from "react";
// import Form from "../../components/userPageComponents/userForm/form";
import Navbar from "../components/HomePage/navbar"

import Background from "../Photos/LogIn.jpg"

function Login () {
    return (
        <div className="bg-gradient-to-t from-purple-300 to-black-500 log-container w-screen h-screen flex flex-col">
            <Navbar logIn={true} register={false} />
            <div className="flex flex-col justify-center items-center items-center h-full w-fit bg-purple-500 rounded-xl">
                <div className="log-box">
                    <div className="login-text select-none">
                        <p>Welcome Back</p>
                    </div>
                    <div className="m-4">
                        {/* <Form isRegistered={true} isStore={isStore} setIsStore={setIsStore} /> */}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Login
